import React from 'react'
import classes from './Modal.module.css';
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

// import { icon } from '@fortawesome/fontawesome-svg-core/import.macro'


const Modal = (props) => {
  return (
    <div className={classes.overlay}>
      <div className={classes.modal}>
        <img className={classes.modalExit} src="../icons/close-icon.svg" alt="Close"/>
        <i class="fa fa-window-close"></i>

        <h2 className={classes.modalTitle}>{props.title}</h2>
        {/* <FontAwesomeIcon icon="fa-solid fa-dice-one" /> */}

        {/* <i className={"fa-solid fa-bars"}></i> */}
        {/* <FontAwesomeIcon icon="fa-solid fa-bars" /> */}
        {/* <i className="fa-solid fa-user"></i> */}
        {/* <FontAwesomeIcon icon={icon({name: 'user-secret'})} /> */}
        {/* <FontAwesomeIcon icon="fa-solid fa-cart-shopping" /> */}

        {/* <FontAwesomeIcon icon={icon({name: 'coffee', style: 'regular'})} />  */}
        {/* <FontAwesomeIcon icon="check-square" />
       Drink: <FontAwesomeIcon icon="mug-hot" /> */}
        <div className={classes.modalStatus}>{props.icon}</div>
        <p className={classes.modalContent}>{props.content}</p>
      </div>
    </div>
  )
}

export default Modal;
